import React from 'react';

import shopData from '../../seeds/shopdata.js'

class ShopPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            collections: shopData
        }
    }

    render() {
        return (
            <div>
                <h1>Shop</h1>
            </div>
        )
    }
}

export default ShopPage;
